import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.css';
import Navbar from './Components/navbar/navbar';
import SignUp from './Components/signup/signup';
import PrivateComponent from './Components/PrivateComponent';





function App() {
  return (
    <div className="App">

      <BrowserRouter>
      <Navbar> </Navbar>
      <Route element={<PrivateComponent/>}>
        <Routes> <Route path='/' element={<h1>Home</h1>}> </Route> </Routes>
        <Routes> <Route path='/MyProject' element={<h1>MyProject</h1>}> </Route> </Routes>
        <Routes> <Route path='/Message' element={<h1>Message</h1>}> </Route> </Routes>
        <Routes> <Route path='/Profile' element={<h1>Profile</h1>}> </Route> </Routes>
        </Route>
        <Routes> <Route path='/SignUp' element={<SignUp></SignUp>}> </Route> </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
